import React, {Component} from "react";
import styles from  './Card.module.scss'
console.log(styles)

class Card extends Component
{
    // eslint-disable-next-line no-useless-constructor
    constructor(props) {
        super(props);
    }
    tovar = this.props.tovar
    render() {
        const btnFun = (event) => {console.log(event)}
        return (
            <div className="card">
                <div className="selected">
                    <img src="/img/like.svg" alt='liked'/>
                </div>
                <img width={133} height={112} src={this.tovar.img} alt='sneacker'/>
                <h5>{this.tovar.name}</h5>
                <div className='d-flex justify-between align-center'>
                    <div className='d-flex flex-column'>
                        <span>Цена:</span>
                        <b>{this.tovar.price} руб.</b>
                    </div>
                    <button className='btn' onClick={(event) => btnFun(event)}>
                        <img width={11} height={11} src="/img/btn.png" alt='btn'/>
                    </button>
                </div>
            </div>
        );
    }
}


export default Card;
